import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal (click on the cart div)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear (cartModal element)
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    // Wait for the cart items container
    await page.waitForSelector('#cartItems', { timeout: 5000 });

    // Take screenshot of cart before removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Check if there is a "Remove" button (cart not empty)
    let removed = false;
    let cartItemTitle = null;
    let cartCountBefore = null;
    let cartCountAfter = null;

    // Get cart count before removal
    try {
      await page.waitForSelector('#cartCount', { timeout: 2000 });
      cartCountBefore = await page.$eval('#cartCount', el => el.textContent.trim());
    } catch {}

    const removeBtn = await page.$('.remove-item');
    if (removeBtn) {
      // Extract the item title for verification
      const cartItem = await page.$('.cart-item');
      if (cartItem) {
        const titleEl = await cartItem.$('.cart-item-title');
        if (titleEl) {
          cartItemTitle = await titleEl.textContent();
          cartItemTitle = cartItemTitle.trim();
        }
      }
      // Click the "Remove" button
      await removeBtn.click();

      // Wait for the cart to update (either empty-cart message or cart item removed)
      await page.waitForTimeout(500); // Small pause for DOM update

      // Take screenshot after removal
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

      removed = true;
    } else {
      // No item to remove, just screenshot the empty cart
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));
    }

    // Get cart count after removal
    try {
      await page.waitForSelector('#cartCount', { timeout: 2000 });
      cartCountAfter = await page.$eval('#cartCount', el => el.textContent.trim());
    } catch {}

    // Extract cart modal text for verification
    let cartModalText = '';
    try {
      await page.waitForSelector('#cartModal', { timeout: 2000 });
      cartModalText = await page.$eval('#cartModal', el => el.innerText);
    } catch {}

    return {
      success: true,
      action: removed
        ? "Removed an item from the cart"
        : "No item in cart to remove",
      extractedData: {
        removed,
        cartItemTitle,
        cartCountBefore,
        cartCountAfter,
        cartModalText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
